  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:22.376186\",\n\t\"name\": \"glaucous-winged-gull-nesting-on-amchitka-island\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The glaucous-winged gull (Larus glaucescens)
  is the most common gull in the north Pacific (Bent 1921, Murie 1959). It is also
  one of the most abundant permanent residents on Amchitka (Williamson & White 1974).
  Between 1967 and 1973 studies and censuses of the avifauna of Amchitka were sponsored
  by the Atomic Energy Commission and counts of glaucous-winged gull abundance were
  generated (White et al 1977). During the 1980 summer season a permanent transect
  was established within the nesting area of a gull colony. This was an attempt to
  sample a representative portion of the total glaucous-winged gull population of
  Amchitka. By compiling data on nesting success and population size over several
  years, trends affecting the gulls were to be determined.\",\n\t\"license_title\":
